import React from "react";
import emptypfp from "./images/emptypfp.png";
import "./home.css";
import { useNavigate, Navigate } from "react-router-dom";
import "./profile.css";
// When Logout is clicked
const Logout = (setCurrentPage) => {
  console.log("log");
  window.localStorage.removeItem("isLoggedIn");
  setCurrentPage = "";
  window.location.reload();
};

const Profile = (props) => {
  props.setCurrentPage("/profile");
  const stringifiedUser = window.localStorage.getItem("userInfo");
  const currentUser = JSON.parse(stringifiedUser);

  const navigate = useNavigate();

/* The code snippet you provided is making a fetch request to
`http://localhost:3001/user/` to retrieve user details from an API endpoint. Here's a
breakdown of what the code is doing: */
  fetch(`http://localhost:3001/user/${currentUser}`)
        .then(response => {
            if (!response.ok) {
                throw new Error(`HTTP error! Status: ${response.status}`);
            }
            return response.json();
        })
        .then(data => {
            if (data && data.success) {
                // Assuming the API response includes a 'data' field with user details
                localStorage.setItem("userInfo", JSON.stringify(data.data));
                console.log("User details updated successfully.");
            } else {
                console.log("No data received, check API response structure or endpoint.");
            }
        })
        .catch(error => {
            console.error("Failed to fetch user details:", error);
        });

  return (
    <>
      <div className="home-app">
        <h1 className="home-title">RENTGMU</h1>
        <div className="topnav">
          <a href="#home" onClick={() => navigate("/home")}>
            Home
          </a>
          <a href="#contact" onClick={() => navigate("/contact")}>
            Contact
          </a>
          <a href="#about" onClick={() => navigate("/about")}>
            About
          </a>
          <a
            href="#MyProfile"
            onClick={() => navigate("/profile")}
            className="active"
          >
            My Profile
          </a>

          <a href="#logout" onClick={() => Logout(props.setCurrentPage)}>
            Logout
          </a>
        </div>
        <div className="profile-container">
          <img
            src={emptypfp}
            width={200}
            height={200}
            alt=""
            className="profile-image"
          />
          <div className="profile-name">
            <h1>{currentUser.name}</h1>
          </div>
          <div className="profile-contact-info">
            <p>Email Address: {currentUser.username}</p>
            {/* <p>Listings: </p> */}
          </div>
        </div>
      </div>
    </>
  );
};

export default Profile;
